import React from 'react';
import generateWeight from './generate-weight';

const recommendationPage = document.querySelector('.title');
// const recommendationPageText = recommendationPage;

window.onload = () => {
    const link = document.getElementById('link');

    alert(typeof recommendationPage.value);
    let blob = new Blob([recommendationPage], {type: 'text/plain'});

    link.href = URL.createObjectURL(blob);
};
